enum symbol_t { VAL, ID, NUM, PLUS, EQU };

const string symbols_string[] = {"VAL", "ID", "NUM", "PLUS", "EQU"};

struct derivation_result_t {};

struct derivation_history_unit_t {
  int production_index = -1;
  size_t offset;
  symbol_t chain_prefix;
};

struct derivation_history_t {
  derivation_history_unit_t dhus[4];
};

inline bool operator==(vector<symbol_t> A, vector<symbol_t> B) {
  return equal(A.begin(), A.end(), B.begin(), B.end());
}

bool check_derivation_history(derivation_history_t &history,
                              const int &production_index,
                              const vector<symbol_t> &chain, size_t &offset) {
  static bool found;
  // bool found = find_if(history.begin(), history.end(),
  //                      [&](const derivation_history_t &unit) {
  //                        return unit.production_index == production_index and
  //                               unit.chain_full_size == chain.size() and
  //                               unit.chain_prefix == chain.front();
  //                      }) != history.end();
  found = history.dhus[production_index].offset >= offset and
          history.dhus[production_index].chain_prefix == chain[offset] and
          history.dhus[production_index].production_index == production_index;
  if (not found) {
    history.dhus[production_index].production_index = production_index;
    history.dhus[production_index].chain_prefix = chain[offset];
    history.dhus[production_index].offset = offset;
  }
  return found;
}

void print_chain(vector<symbol_t> &chain) {
  for (const auto &symbol : chain) {
    cout << symbols_string[symbol] << " ";
  }
  cout << endl << endl;
}

inline bool _handle_terminal(derivation_history_t &history,
                             vector<symbol_t> &chain,
                             derivation_result_t &result, const symbol_t symbol,
                             size_t &offset) {
  try {
    if (offset < chain.size() and chain[offset] == symbol) {
      offset++;
      return true;
    }
  } catch (runtime_error &e) {
    cerr << e.what();
  }
  return false;
}

// VAL -> NUM
inline bool _handle_val__num(derivation_history_t &history,
                             vector<symbol_t> &chain,
                             derivation_result_t &result, size_t &offset) {
  try {
    static const vector<symbol_t> dchain = {NUM};
    // if (check_derivation_history(history, 3, chain))
    //   return false;
    if (equal(dchain.begin(), dchain.end(), chain.begin() + offset,
              chain.begin() + offset + dchain.size())) {
      // chain.erase(chain.begin(), chain.begin() + dchain.size());
      offset += dchain.size();
      return true;
    }
  } catch (runtime_error &e) {
    cerr << e.what();
  }
  return false;
}

// VAL -> VAL PLUS VAL
inline bool _handle_val__val_plus_val(derivation_history_t &history,
                                      vector<symbol_t> &chain,
                                      derivation_result_t &result,
                                      size_t &offset) {
  try {
    static const symbol_t dchain[] = {VAL, PLUS, VAL};
    static const auto dchain_size = sizeof(dchain) / sizeof(symbol_t);
    // dchain has more elements than chain cancel
    if (dchain_size + offset > chain.size())
      return false;
    if (check_derivation_history(history, 2, chain, offset)) {
      return false;
    }
    if (not(_handle_val__val_plus_val(history, chain, result, offset) or
            _handle_val__num(history, chain, result, offset)))
      return false;
    if (not(_handle_terminal(history, chain, result, dchain[1], offset)))
      return false;
    if (not(_handle_val__val_plus_val(history, chain, result, offset) or
            _handle_val__num(history, chain, result, offset)))
      return false;
    return true;
  } catch (runtime_error &e) {
    cerr << e.what();
  }
  return false;
}

// ASGN -> ID EQU VAL
inline bool _handle_asgn__id_equ_val(derivation_history_t &history,
                                     vector<symbol_t> &chain,
                                     derivation_result_t &result,
                                     size_t &offset) {
  try {
    if (check_derivation_history(history, 1, chain, offset))
      return false;
    static const symbol_t dchain[] = {ID, EQU, VAL};
    if (not(_handle_terminal(history, chain, result, dchain[0], offset)))
      return false;
    if (not(_handle_terminal(history, chain, result, dchain[1], offset)))
      return false;
    if (not(_handle_val__val_plus_val(history, chain, result, offset) or
            _handle_val__num(history, chain, result, offset)))
      return false;
    return true;
  } catch (runtime_error &e) {
    cerr << e.what();
  }
  return false;
}

bool _parse(derivation_history_t &history, vector<symbol_t> &chain,
            derivation_result_t &result) {
  size_t offset = 0;
  return _handle_asgn__id_equ_val(history, chain, result, offset) &&
         offset == chain.size();
}

